style.css:
body {
    font-family: Arial, sans-serif;
    background-color: #6a0dad; /* Purple background color */
    color: #fff; /* White text color */
    margin: 0;
    padding: 0;
}

header {
    background-color: #4a047a; /* Dark purple header color */
    padding: 20px;
    text-align: center;
}

h1 {
    margin: 0;
}

nav {
    background-color: #4a047a; /* Dark purple navigation bar color */
    padding: 10px;
}

nav ul {
    list-style-type: none;
    margin: 0;
    padding: 0;
}

nav ul li {
    display: inline;
    margin-right: 20px;
}

nav ul li a {
    color: #fff; /* White link color */
    text-decoration: none;
}

section {
    padding: 20px;
}

footer {
    background-color: #4a047a; /* Dark purple footer color */
    padding: 10px;
    text-align: center;
}
